  const [text, setText] = React.useState("abcd");



  return (
    <div>
      <div> 5! = </div>
      <input
        value={text}
        onChange={(event) => {
          setText(event.target.value);
        }}
      ></input>
      <button
        onClick={() => {
          setText("");
        }}
      >
        Reset
      </button>
    </div>
  );
}

export default App;
